var GraphHandler=function(){this.getOptions=function(t){switch(t){case"bar":return options={bars:{show:!0,barWidth:.3,align:"center"},xaxis:{mode:"time",timeformat:"%m/%d/%y"}};case"line":return options={lines:{show:!0},xaxis:{mode:"time",timeformat:"%m/%d/%y"}};case"point":return options={points:{show:!0},xaxis:{mode:"time",timeformat:"%m/%d/%y"}};case"area":return options={lines:{show:!0,fill:!0},xaxis:{mode:"time",timeformat:"%m/%d/%y"}}}},this.getGraph=function(t,e,i){var r=this.dataConverter(t),o=this.getOptions(e),a={label:"Flu Prescriptions",color:"#0F75BC",grid:{borderWidth:0,color:"#58585A",labelMargin:10},data:r};$.plot($(i),[a],o)},this.dataConverter=function(t){for(var e,i,r=0,o=[],a=[],r=0;r<=t.length-1;r++)e=Date.parse(t[r].prescription_time),i=t[r].total,a.push(e),a.push(i),o.push(a),a=[];return o}};